import React from 'react'
import '../style/Home.css'
import Pizza from '../imag/pizza.png';

export default function Home() {
    return (
        <div className= "Container">
            <div className="menu_img">
               <img className="pizza" src={Pizza}/>
               <p>Pizza</p>
           </div>

        </div>
    )
}
